Rainbow Poem Code-Along
In this activity, take an existing poem and make it your own!
Current Site
Start by taking a look at the existing website. Try to figure out what it does! In the HTML, it has a header, a picture, and a few paragraphs with lines from a poem. In the CSS, it sets some of the basic colors and creates a couple classes. The first two lines of the poem are rainbow, but the rest are plain white. In this activity, update the HTML and CSS so that the whole poem is a rainbow!
First - Fixing the Image
Before updating the text, start by updating the CSS for the image. Set its width and its border.

Open the style.css file
Create a new ruleset for img
Start with img
Then add { and }
Press Enter between them to open up a new line


On the new line, create a declaration setting width to 150px
Make another line under that
Create another declaration setting border to 1px solid pink

The code should look something like this:
img {
  height: 150px;
  border: 5px solid pink;
}

A Green Line
In the HTML, the first three  elements for the poem have class attributes. Two of these are doing what they are supposed to-- the class="red" is setting the color to red, and the class="yellow" is setting the color to yellow. Why is the class="green" not working? Take a look at the CSS.
In the CSS, there are two rulesets that change the color: .red and .yellow. These set the  to red and the  to yellow.
Add another ruleset to set all  elements to be green.

Hint: for a nice bright green, use lime.

.green {
    color: lime;
}

After adding that CSS, the third line should turn green!
A Blue Line
Setting the fourth line to blue will be very similar to the first three lines - this time, it will be necessary to update both the HTML and the CSS.
CSS
First, create a new ruleset to select elements with a class of blue: .blue { }
Within that ruleset, set the color to a nice light blue: color: cyan
.blue {
    color: cyan;
}

After adding that CSS, nothing should happen - the HTML still needs to be updated.
HTML
Now that a ruleset has been created, it can be used to style HTML elements.

Open the HTML file for editing
Find the  element with the fourth line of the poem
Add a class attribute to the paragraph
Set the value of the class attribute to blue

I'll tell you how I became the prince of a town called Bel-Air

After adding that in the HTML, the fourth line should become blue!
The Second Verse
For the second verse, only the HTML will need to change. Update te next four  elements so that they show up in rainbow colors!
For each paragraph, add a class attribute with a value for either red, yellow, green, or blue. After updating the HTML, check out the site and make sure the text changes color properly!
Final HTML





    My Poem

    Now this is a story all about how
    My life got flipped turned upside down
    And I'd like to take a minute, just sit right there
    I'll tell you how I became the prince of a town called Bel-Air

    In West Philadelphia born and raised
    On the playground is where I spent most of my days
    Chillin' out, maxin', relaxin' all cool
    And all shootin' some b-ball outside of the school



Final CSS
body {
  background: black;
  color: white;
}

.red {
  color: red;
}

.yellow {
  color: yellow;
}

img {
  height: 150px;
  border: 5px solid pink;
}

.green {
  color: lime;
}

.blue {
  color: cyan;
}

JavaScript/QuizCodeAlong.html.body:
About Me Quiz - JavaScript Lesson
Learn how JavaScript can make websites interactive by building a simple quiz about yourself.
Starting Point
Start by forking this Repl project. It contains some HTML and CSS starter code for the About Me website.
Update the Starter HTML
Wherever the word "blank" appears in the index.html file, update it to personalize your website! For example, where it says "I'm blank," replace the "blank" with your name.
Update the Starter CSS
In the style.css file, change the background color, text color, and font!
Interactivity with JavaScript
JavaScript is the programming language of the web; it allows webpages to be interactive. Developers use JavaScript to trigger events, create animations, make games, and much more!
The next step for the site is to add functionality to the "Quiz Me" button. It should pop up a quiz that allows the user to answer some questions and receive a final score. This is possible with JavaScript!
Defining the Function
Developers use functions in JavaScript to trigger certain actions. In this example, clicking the "Quiz Me" button will call a JavaScript function. That means it triggers some actions! alert is the command that lets developers show messages to the user on a webpage.

Open the script.js file in the Repl project
Create an empty function definition for the startQuiz function
This requires the function keyword, the function name, parentheses, and curly brackets


In the body of the function, add an alert statement that welcomes the user

The code so far should look something like this:
function startQuiz() {
    alert("Welcome to my quiz :)");
}

Run the program. On the webpage, click the button to make sure it is hooked up properly! Note that this is possible because of the onclick attribute on the HTML button.
Receiving Information from the User
prompt is a command that allows us to ask questions to the user. When the user answers, the computer stores that text in a variable. Developers can then reference that information in the future!

Under the alert, above the }, create a couple new lines
Declare a name variable, and use a prompt to ask for the user's name
On the next line, use an alert to say "Good luck" to the user (using their name!)

var name = prompt("What is your name?");
alert("Good luck " + name);

Run the program, click the button again, and make sure the prompt appears. The site should say good luck!
Setting up the Quiz Variables

Under the previous alert, above the }, create a couple new lines
Declare a points variable
This will be used to keep track of how many points the user has earned (i.e., how many questions they have answered correctly)
How many points should the user have at the beginning? (0)


Declare a numberOfQuestions variable
To start, set this value to 2



var points = 0;
var numberOfQuestions = 2;

Asking a Question
if statements allow developers to change the program flow based on certain information. It works just like in English; for example, "if it is raining, I will wear a raincoat." In code, the program will do different things based on what the user says! For the quiz, the points should go up every time the user answers correctly. So, "if the answer from the user is equal to the correct answer, increase the points!"

Under the numberOfQuestions variable declaration, above the }, create a couple new lines
Ask the user a question using prompt (e.g., "What is my name?")
Store the user's answer in a variable called answer1
Under the prompt, create an if statement
What should happen based on the user's answer?
If the user is correct, they should get a point. Otherwise, they should not.


Use if, parentheses, ===, and curly brackets to set up the if
Within the curly brackets, use ++ to increment the value of the points variable

var answer1 = prompt("What is my name?");
if (answer1 === "Joseph") {
    points++;
}

Run the program and click the button again. It should ask the question, and allow the user to answer!
Asking another Question

Repeat the steps above to ask another question underneath the first question
The differences will be:
answer2 instead of answer1 for the variable
Ask a different question
Check a different answer



var answer2 = prompt("Where do I live?");
if (answer2 === "Lakewood") {
    points++;
}

Run the program, click the button, and see the second question!
Calculating the Final Score
Finally, it is possible to use the points variable to determine an overall score. Do some math to calculate the percentage against the total number of questions!

NOTE: This section can be skipped and replaced with an alert that simply displays the number of points at the end


Consider how to calculate the final score
The score will be the number of points the user has, divided by the total number of questions
Multiply this by 100 to show a percentage


Under the final question, declare a finalScore variable
Calculate the final score by dividing the points variable by the numberOfQuestions variable
Multiply this by 100 to show a percentage


Use an alert to show the final score to the user

var finalScore = (points / numberOfQuestions) * 100;
alert("Final score: " + finalScore + "%");

Run the program, click the button, and take the quiz. The final score should change based on the answers to the questions!
Final JavaScript Code
function startQuiz() {
  alert("Welcome to the quiz :)");

  var name = prompt("What is your name?");
  alert("Good luck " + name);

  var points = 0;
  var numberOfQuestions = 2;

  var answer1 = prompt("What is my name?");
  if (answer1 === "Joseph") {
    points++;
  }

  var answer2 = prompt("Where do I live?");
  if (answer2 === "Lakewood") {
    points++;
  }

  var finalScore = (points / numberOfQuestions) * 100;
  alert("Final score: " + finalScore + "%");
}

Individual Work
If there is time remaining, work on these individual exercises.

